using registers = std::array<int, 4>;

struct input_data
{
	int opCode;
	int a;
	int b;
	int c;
};


auto addr = [&](registers reg, input_data d)
{
	//addr (add register) stores into register C the result of adding register A and register B.
	reg[d.c] = reg[d.a] + reg[d.b];
	return reg;
};


auto addi = [&](registers reg, input_data d)
{
	//addi (add immediate) stores into register C the result of adding register A and value B.
	reg[d.c] = reg[d.a] + d.b;
	return reg;
};

auto mulr = [&](registers reg, input_data d)
{
	//(multiply register) stores into register C the result of multiplying register A and register B.
	reg[d.c] = reg[d.a] * reg[d.b];
	return reg;
};

auto muli = [&](registers reg, input_data d)
{
	//(multiply immediate) stores into register C the result of multiplying register A and value B.
	reg[d.c] = reg[d.a] * d.b;
	return reg;
};


auto banr = [&](registers reg, input_data d)
{
	//(bitwise AND register) stores into register C the result of the bitwise AND of register A and register B.
	reg[d.c] = reg[d.a] & d.b;
	return reg;
};

auto bani = [&](registers reg, input_data d)
{
	//bani (bitwise AND immediate) stores into register C the result of the bitwise AND of register A and value B.
	reg[d.c] = reg[d.a] & d.b;
	return reg;
};


auto borr = [&](registers reg, input_data d)
{
	//(bitwise OR register) stores into register C the result of the bitwise OR of register A and register B
	reg[d.c] = reg[d.a] | reg[d.b];
	return reg;
};

auto bori = [&](registers reg, input_data d)
{
	//(bitwise OR immediate) stores into register C the result of the bitwise OR of register A and value B.
	reg[d.c] = reg[d.a] | d.b;
	return reg;
};


auto setr = [&](registers reg, input_data d)
{
	//setr (set register) copies the contents of register A into register C. (Input B is ignored.)
	reg[d.a] = reg[d.c];
	return reg;
};

auto seti = [&](registers reg, input_data d)
{
	//seti (set immediate) stores value A into register C. (Input B is ignored.)
	reg[d.c] = d.a;
	return reg;
};


auto gtir = [&](registers reg, input_data d)
{
	//gtir (greater-than immediate/register) sets register C to 1 if value A is greater than register B. Otherwise, register C is set to 0.
	auto val = d.a > reg[d.b];
	reg[d.c] = val;
	return reg;
};

auto gtri = [&](registers reg, input_data d)
{
	//gtri (greater-than register/immediate) sets register C to 1 if register A is greater than value B. Otherwise, register C is set to 0.
	auto val = reg[d.a] > d.b;
	reg[d.c] = val;
	return reg;
};


auto gtrr = [&](registers reg, input_data d)
{
	//gtrr (greater-than register/register) sets register C to 1 if register A is greater than register B. Otherwise, register C is set to 0.
	auto val = reg[d.a] > reg[d.b];
	reg[d.c] = val;
	return reg;
};

auto eqir = [&](registers reg, input_data d)
{
	//eqir(equal immediate / register) sets register C to 1 if value A is equal to register B.Otherwise, register C is set to 0.
	auto val = d.a == reg[d.b];
	reg[d.c] = val;
	return reg;
};


auto eqri = [&](registers reg, input_data d)
{
	//eqri (equal register/immediate) sets register C to 1 if register A is equal to value B. Otherwise, register C is set to 0.
	auto val = reg[d.a] == d.b;
	reg[d.c] = val;
	return reg;
};

auto eqrr = [&](registers reg, input_data d)
{
	//(equal register/register) sets register C to 1 if register A is equal to register B. Otherwise, register C is set to 0.
	auto val = reg[d.a] == reg[d.b];
	reg[d.c] = val;
	return reg;
};

